import React from "react";

const Main = () => {
  return <>
    <div className="Main shadow-sm border mt-5">
        <div className="container">
            <div className="title">
                <h1>I am Main Components</h1>
                <p></p>
                <button className="btn btn-primary"></button>
            </div>
        </div>
    </div>
  </>;
};

export default Main;
